import React from 'react';
import{Link} from "react-router-dom";
import './login.css';
function Login(){
    function con(){
        alert("LoggedIn Successfully");
    }
    return(
        
        <div className="login">
        
                    <img src="byjus.png" alt="logo" width="200" height="150"></img>
                   <center> <p><b>Let's Get Started</b><br/>
Enter your mobile number to sign up/ sign in to
your BYJU'S account</p></center><br/>
            <div class="name">
                <label>Name:</label><br/>
                <input type="text"></input>
            </div><br/>
            <div class="phno">
                <label>Mobile No:</label><br/>
                <input type="number"></input>
            </div><br/>
            <div class="btn">
                <button onClick={con}>Continue</button>
            </div>
        </div>
    
    )
} 
export default Login
